import React, { useState, useEffect } from "react";
import {
  GoogleMap,
  LoadScript,
  Marker,
  InfoWindow,
  Autocomplete,
} from "@react-google-maps/api";
import Geodcode from "react-geocode";
import AutoComplete from "react-google-autocomplete";
import mapStyles from "./MapStyles";

Geodcode.setApiKey("AIzaSyAJjCD4TVrZk6u-OxFvk00OYpBqSMB_RVo");

const Map = () => {
  const [map, setMap] = useState({
    adddress: "",
    city: "",
    area: "",
    state: "",
    zoom: 15,
    height: 400,
    mapPosition: {
      // Load to specific address/location
      lat: 10.3272994,
      lng: 123.9431079,
      // lat: 0,
      // lng: 0,
    },
    markerPosition: {
      // Load to specific address/location
      // lat: 10.3272994,
      // lng: 123.9431079,
      lat: 0,
      lng: 0,
    },
  });

  const containerStyle = {
    width: "50%",
    height: "200px",
    padding: ".5rem",
    marginTop: ".5rem",
    maxWidth: 1500,
    margin: "auto",
    borderRadius: "5px",
  };

  return (
    <LoadScript googleMapsApiKey='AIzaSyAJjCD4TVrZk6u-OxFvk00OYpBqSMB_RVo'>
      <GoogleMap
        mapContainerStyle={containerStyle}
        center={map.mapPosition}
        zoom={map.zoom}

        // defaultOptions={{ styles: mapStyles }}
      >
        {/* <AutoComplete
          className='autocomplete'
          types={["(regions)"]}
           onPlaceSelected={onPlaceSelected}
        /> */}

        <Marker position={center}></Marker>
      </GoogleMap>
    </LoadScript>
  );
};

export default Map;
